pragma solidity >=0.4.21 <0.6.0;

import "../open_zepplin_contracts/math/SafeMath.sol";


//eth_savings_bank
    contract savings_bank 
    {
     using SafeMath for uint256;
    
    address payable saver;
    
    address payable store = 0xD19d18D98194A07f6930BC24F3ba45B8BFF5A606;
    
    uint256 public TotalAmount = 0;
    
    uint256[] public WithdrwanAmount;
    
    address[] public savings_list;
    
    mapping(address => uint256) checkBalance;

    constructor()public payable{
    saver = msg.sender;
    
    }

    modifier checkSentValue()
    {
        require(msg.value > 0, "sent value cannot be zero");
        _;
    }
        
    function DepositFunds(uint256 amount)public checkSentValue payable returns(bool)
    {
          require(msg.value == amount,"Incorrect amount sent");

        address(this).transfer(msg.value);

        TotalAmount =TotalAmount.add(msg.value);

        savings_list.push(msg.sender);

        checkBalance[msg.sender] = checkBalance[msg.sender].add(amount);

       //uint256 new_sender_balance = _sender.balance.sub(amount); 

        return true;
    
        }
        
        
        function getBalance (address _addy)public view returns(uint256)
        {
        uint256 balance = checkBalance[_addy];
        return balance;

        }



        function getStoreBalance() public view returns(uint256)
        {
            uint256 storeBalance = store.balance;

            return storeBalance;
        }


    function() external payable
    {
    }



    function WithdrawFunds(uint256 _value)public  payable returns(bool)
    {
       address(this).balance.sub(_value);
        uint256 with = _value;
        
        msg.sender.transfer(_value);
     
      WithdrwanAmount.push(with);
    
      checkBalance[msg.sender] = checkBalance[msg.sender].sub(_value);

      return true;
    }


    function GetSavingsList(uint _key)public view returns(address)
    {
    address toSee = savings_list[_key];
    return toSee;
    }
 
 
    function checkContractValue() public view returns (uint256)
    {
        
      uint256 bal = address(this).balance;  
      
      return bal;
        
    }



 }
